script: |
  super -f text -I q6985.spq | sort > q6985.out

inputs:
  - name: q6985.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab0 (FORMAT parquet) WHERE + 45 NOT BETWEEN col0 * - col2 AND + 46 * - 23 - - col0;
  - name: tab0

outputs:
  - name: q6985.out
    data: |
      15
      87
      97
